Happy Friday, everyone! 🙌🏼

I received some amazing Korean-beauty products from @ohlollybeauty! Ohlolly is an online store that’s owned by two sisters, who has curated their inventory to carry only top quality Korean skincare/makeup brands. I reviewed these products for their Ohlolly Goes series and had so much fun doing it! 

My brief thoughts:
@sioris_official Stay with me Day Cream 👉🏻 This is packed with a lot of great ingredients and ideal for combo to oily skin. 

@dr.ceuracle_global Royal Vita Propolis 33 Ampoule 👉🏻 This is my first time using an ampoule, and I’m not stopping now! It definitely brightened my skin and I love that it feels so luxurious. 

@clecosmetics Melting Lip Powder 👉🏻 This lip technology is so cool!! It’s so powdery in the bottle, but it goes on your lips so nicely. It has a cooling sensation to it and the pigment is POPPIN. 

