I wanted to share this video with you all because I've curated a morning skincare regimen that has my skin GLOWING in the morning. Just watch the video and see for yourself! 😍
I've been using these skincare products from black-owned brands and call me obsessed!💕

All are high quality products with amazing ingredients. With the exception of the essence (3wks), I've been using the rest of the products in the morning for well over a month. I recommend these products for people who have acne-prone, sensitive, and combination skin because all of these products are gentle and none of them irritated my skin.😌

Let's keep amplifying black voices and businesses because not only do they matter, but black lives are worthy, beloved, and needed. Please go and support any way you can and able to!🖤

